import React from 'react';
import './App.css';
import emotion from "./Icons/Small Icons/mood-24px-grey.svg";
import tactor from "./Icons/Small Icons/tactor-grey.svg";
import behavior from "./Icons/Small Icons/touch-grey.svg";
import neutral from "./Icons/Emotion/Emotion_Neutral.svg";
import happiness from "./Icons/Emotion/Emotion_Happiness .svg";
import fear from "./Icons/Emotion/Emotion_Fear.svg";
import sympathy from "./Icons/Emotion/Emotion_Sympathy.svg";
import sadness from "./Icons/Emotion/Emotion_Sadness.svg";
import anger from "./Icons/Emotion/Emotion_Anger.svg";
import disgust from "./Icons/Emotion/Emotion_Disgust.svg";
import love from "./Icons/Emotion/Emotion_Love.svg";
import gratitude from "./Icons/Emotion/Emotion_Gratitude.svg";
import shake from "./Icons/Tactor/Gesture icons_Shake.svg";
import squeeze from "./Icons/Tactor/Gesture icons_Squeeze-15.svg";
import hit from "./Icons/Tactor/Gesture icons_Hit.svg";
import pat from "./Icons/Tactor/Gesture icons_Pat-14.svg";
import push from "./Icons/Tactor/Gesture icons_Push-21.svg";
import rub from "./Icons/Tactor/Gesture icons_Rub-18.svg";
import stroke from "./Icons/Tactor/Gesture icons_Stroke.svg";
import tap from "./Icons/Tactor/Gesture icons_Tap-17.svg";
import trange from "./Icons/Small Icons/touch_range.svg";
import tspeed from "./Icons/Small Icons/speed-touch.svg";
import rspeed from "./Icons/Small Icons/speed_retreat.svg";
import randomness from "./Icons/Small Icons/Touch_randomness.svg";
import tint from "./Icons/Small Icons/touch_interval.svg";
import irand from "./Icons/Small Icons/interval_randomness.svg";
import play from "./Icons/play-filled.svg";
import pause from "./Icons/pause-filled.svg";
import arrow from "./Icons/Small Icons/arrow.svg";
import Emotion from './emotion';

//TO DO: Add the emotion and placeholders to the left bar.
//Allow users to go home with the top navigation
//Allow users to clear selection of tactor and emotion
//Add graph and sliders
//Add serial library
//Add Archive


class LeftNav extends React.Component{



constructor(props) {
  super(props);
  this.state = {
    home: true,
    emotion: false,
    tactor: false,
    behavior: false,
    eselected:false,
    eicon: null,
    ename: null,
    tselected:false,
    ticon: null,
    tname: null,
    trange:[null,null,null],
    tspeed:[null,null,null],
    rspeed:[null,null,null],
    randomness:[null,null,null],
    tint:[null,null,null],
    irand:[null,null,null],
    shake: null,
    squeeze: null,
    hit: null,
    pat: null,
    push: null,
    rub: null,
    stroke: null,
    tap: null,
  };
}

handleClick(name) {
  switch (name) {
    case "emotion":
      this.setState({ home: false, emotion:true, tactor: false, behavior: false});
      break;
    case "tactor":
      this.setState({home: false, emotion: false, tactor: true, behavior: false});
      break;
    case "behavior":
      this.setState({home: false, emotion: false, tactor: false, behavior: true});
      break;
  }
}

emotionSelect(name){
this.setState({eselected:true});
  switch (name) {
    case "happiness":
      this.setState({eicon:happiness, ename: "Happiness", shake:"suggested", squeeze: "suggested",hit: null,pat: null,push: null,rub: null,stroke: null,tap: null,});
      break;
    case "fear":
        this.setState({eicon:fear, ename: "Fear", shake:"suggested", squeeze: "suggested",hit: null,pat: null,push: null,rub: null,stroke: null,tap: null,});
        break;
    case "sympathy":
        this.setState({eicon: sympathy, ename: "Sympathy",shake:"suggested", squeeze: null,hit: null,pat: "suggested",push: null,rub: "suggested",stroke: "suggested",tap: null,});
        break;
    case "sadness":
      this.setState({eicon: sadness, ename: "Sadness", shake:"suggested", squeeze: "suggested",hit: null,pat: "suggested",push:"suggested",rub: null,stroke: "suggested",tap: null,});
      break;
    case "anger":
      this.setState({eicon: anger, ename: "Anger", shake:null, squeeze: "suggested",hit: "suggested",pat: null,push:"suggested",rub: null,stroke: null,tap: null,});
      break;
    case "disgust":
      this.setState({eicon: disgust, ename:"Disgust", shake:null, squeeze: null,hit: null,pat: null,push: "suggested",rub: null,stroke: null,tap: null,});
      break;
    case "love":
      this.setState({eicon: love, ename: "Love", shake:"suggested", squeeze: "suggested",hit: null,pat: "suggested",push: null,rub: "suggested",stroke: "suggested",tap: null,});
      break;
    case "gratitude":
      this.setState({eicon: gratitude, ename:"Gratitude", shake:"suggested", squeeze: "suggested",hit: null,pat: "suggested",push: null,rub: null,stroke: null,tap: "suggested",});

  }
}

tactorSelect(name){
this.setState({tselected:true});

  switch (name) {
    case "shake":
      this.setState({ticon:shake, tname: "Shake"});
      if (this.state.eicon == gratitude) {
          this.setState({trange:[40,20,50], tspeed:[125,90,160], rspeed:[90,85,105], randomness:[12,4,20], tint: [165,200,270], irand:[27,0,87],});
        }else if(this.state.eicon == happiness){
          this.setState({trange:[40,30,60], tspeed:[108,96,136], rspeed:[105,84,108], randomness:[5,0,15], tint: [160,120,240], irand:[0,0,10],});
        }else if(this.state.eicon == sadness){
          this.setState({trange:[40,30,40], tspeed:[35,30,35], rspeed:[48,40,54], randomness:[5,2,8], tint: [265,247,282], irand:[0,0,0],});
        }else if(this.state.eicon == sympathy){
          this.setState({trange:[30,20,40], tspeed:[36,30,66], rspeed:[24,24,66], randomness:[0,0,5], tint:[50,25,525], irand:[0,0,20],});
        }else if(this.state.eicon == love){
          this.setState({trange:[60,40,70], tspeed:[48,33,70], rspeed:[60,50,66], randomness:[2,0,5], tint:[40,7,252], irand:[16,9,22],});
        }else{
          this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
        }
      break;
    case "squeeze":
        this.setState({ticon:squeeze, tname: "Squeeze"});
        if (this.state.eicon == anger) {
            this.setState({trange:[60,60,60], tspeed:[285,257,315], rspeed:[120,99,153], randomness:[17,13,21], tint: [135,117,152], irand:[97,83,111],});
          }else if(this.state.eicon == fear){
            this.setState({trange:[40,20,40], tspeed:[165,105,204], rspeed:[120,72,156], randomness:[10,10,25], tint: [160,50,250], irand:[30,0,60],});
          }else if(this.state.eicon == gratitude){
            this.setState({trange:[50,40,50], tspeed:[82,70,94], rspeed:[60,50,70], randomness:[8,4,11], tint: [635,467,802], irand:[25,12,40],});
          }else if(this.state.eicon == happiness){
            this.setState({trange:[70,60,80], tspeed:[133,132,135], rspeed:[144,126,162], randomness:[12,8,16], tint:[50,25,75], irand:[0,0,0],});
          }else if(this.state.eicon == love){
            this.setState({trange:[70,50,90], tspeed:[72,72,72], rspeed:[48,42,54], randomness:[0,0,5], tint: [10,5,155], irand:[0,0,24],});
          }else{
            this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
          }
        break;
    case "hit":
        this.setState({ticon: hit, tname: "Hit"});
        if (this.state.eicon == anger) {
            this.setState({trange:[70,30,70], tspeed:[225,198,258], rspeed:[90,66,132], randomness:[5,0,5], tint: [280,170,290], irand:[0,0,40],});
          }else{
            this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
          }
        break;
    case "pat":
      this.setState({ticon: pat, tname: "Pat"});
      if (this.state.eicon == gratitude) {
          this.setState({trange:[50,40,50], tspeed:[82,70,94], rspeed:[60,50,70], randomness:[8,4,15], tint: [635,467,802], irand:[25,12,38],});
        }else if(this.state.eicon == love){
          this.setState({trange:[60,40,60], tspeed:[90,87,93], rspeed:[48,46,48], randomness:[0,0,5], tint: [280,255,375], irand:[0,0,0],});
        }else if(this.state.eicon == sadness){
          this.setState({trange:[40,30,60], tspeed:[50,30,71], rspeed:[42,27,57], randomness:[2,0,9], tint: [320,262,422], irand:[15,0,52],});
        }else if(this.state.eicon == sympathy){
          this.setState({trange:[40,30,50], tspeed:[36,30,63], rspeed:[33,25,45], randomness:[12,8,16], tint:[50,25,75], irand:[0,0,0],});
        }else{
          this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
        }
        console.log(this.state.trange);
      break;
    case "push":
      this.setState({ticon: push, tname: "Push"});
      if (this.state.eicon == anger) {
          this.setState({trange:[60,50,70], tspeed:[105,96,144], rspeed:[120,84,144], randomness:[10,0,15], tint: [0,0,300], irand:[0,0,70],});
        }else if(this.state.eicon == disgust){
          this.setState({trange:[40,30,50], tspeed:[105,30,168], rspeed:[70,60,90], randomness:[0,0,25], tint: [220,50,370], irand:[0,0,65],});
        }else if(this.state.eicon == sadness){
          this.setState({trange:[50,40,50], tspeed:[54,39,70], rspeed:[66,57,75], randomness:[5,5,5], tint: [390,230,550], irand:[50,45,55],});
        }else{
          this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
        }
      break;
    case "rub":
      this.setState({ticon: rub, tname:"Rub"});
      break;
    case "stroke":
      this.setState({ticon: stroke, tname: "Stroke"});
      break;
    case "tap":
      this.setState({ticon: tap, tname:"Tap"});
      if (this.state.eicon == anger) {
          this.setState({trange:[50,40,70], tspeed:[125,110,140], rspeed:[85,72,90], randomness:[5,3,15], tint: [300,190,480], irand:[20,10,40],});
        }else{
          this.setState({trange:[0,0,0], tspeed:[0,0,0], rspeed:[0,0,0], randomness:[0,0,0], tint: [0,0,0], irand:[0,0,0],});
        }
      break;
  }
}


handleSlider(name){
switch (name) {
  case "trange":
      this.setState({trange: document.getElementById("touch-range").value});
    break;
  case "tspeed":
      this.setState({tspeed: document.getElementById("speed-touch").value});
    break;
  case "rspeed":
      this.setState({rspeed: document.getElementById("speed-retreat").value});
    break;
  case "randomness":
      this.setState({randomness: document.getElementById("touch-randomness").value});
    break;
  case "tint":
      this.setState({tint: document.getElementById("touch-interval").value});
    break;
  case "irand":
      this.setState({irand: document.getElementById("interval-randomness").value});
    break;
}

}



