                    <img src={happiness} alt="" className="emotion-logo happiness"/>
                  </div>

                    <h4 className="text-center">Happiness</h4>

                  </div>
                  <div className="col">
                    <div className="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("fear"), this.handleClick("tactor"))}>
                      <img src={fear} alt="" className="emotion-logo fear"/>
                    </div>
